import React, { useState, useContext } from "react";
import { Link } from "react-router-dom";
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import GradeOutlinedIcon from '@mui/icons-material/GradeOutlined';
import LocalMallOutlinedIcon from '@mui/icons-material/LocalMallOutlined';
import "./Navbar.css";
import Cart from '../../pages/Cart/Cart';
import { UserContext } from "../../pages/User/UserProvider.jsx"
import { CartContext } from "../../pages/Cart/CartProvider";
import axios from "axios";
import logo from "../../images/CandyLand_Logo_Blue.png";

const Navbar = () => {
  const [open, setOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const { user } = useContext(UserContext);
  const { getCartSize } = useContext(CartContext);
  const [searchResults, setSearchResults] = useState([]);

  const candyProducts = [
    // Existing candy products
    {
      id: 1,
      type: "CandyBar",
      name: "Snickers",
      price: 1.99,
      description: "Peanuts, caramel, nougat, and chocolate",
    },
    // ... rest of the candy products
  ];

  const handleSearch = async (query) => {
    setSearchQuery(query);
    try {
      const searchResults = await axios.post(
        "http://localhost:4000/api/products/search",
        { searchQuery: query }
      );
      if (searchResults.data) {
        console.log("Product found");
        setSearchResults(searchResults.data);
      } else {
        console.log("Search failed");
      }
    } catch (error) {
      console.error("Could not find product", error);
    }
  };

  return (
    <div className="Navbar">
      <div className="wrapper">
        <div className="center">
          <Link className="link" to="/">
            <img className="logo" src={logo} alt="Candyland Logo" />
          </Link>
        </div>
        <div className="left"></div>
        <div className="item">
          <Link className="link" to="/products/CandyBar">
            Candy Bars
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyCorn">
            Candy Corn
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyStick">
            Candy Sticks
          </Link>
        </div>
        <div className="right">
          {/* Search Bar */}
          <div className="searchBar">
            <input
              className="searchInput"
              type="text"
              value={searchQuery}
              onChange={(e) => handleSearch(e.target.value)}
              placeholder="What are you looking for?"
            />
            <div className="searchButton">
              <SearchOutlinedIcon className="searchIcon" />
            </div>
            <div className="dropDownMenu">
              {candyProducts
                .filter((item) => {
                  const searchTerm = searchQuery.toLowerCase();
                  const itemName = item.name.toLowerCase();
                  return (
                    searchTerm &&
                    itemName.startsWith(searchTerm) &&
                    itemName !== searchTerm
                  );
                })
                .slice(0, 5)
                .map((item) => (
                  <div
                    onClick={() => handleSearch(item.name)}
                    className="dropDownRow"
                    key={item.id}
                  >
                    {item.name}
                  </div>
                ))}
            </div>
          </div>
          <div className="item">
            <Link className="link" to="/">
              About
            </Link>
          </div>
          <div className="item">
            <Link className="link" to="/">
              Contact
            </Link>
          </div>
          <div className="icons">
            <Link className="link" to="/account">
              <AccountCircleOutlinedIcon />
            </Link>
            <Link className="link" to="/account/favorites">
              <GradeOutlinedIcon />
            </Link>
            <div className="cartIcon" onClick={() => setOpen(!open)}>
              <LocalMallOutlinedIcon />
              <span>{getCartSize()}</span>
            </div>
          </div>
        </div>
      </div>
      {open && <Cart />}
    </div>
  );
};

export default Navbar;
